import { StyleSheet } from "react-native";

export default StyleSheet.create({
    pag:{
        borderColor: 'black',
        alignItems: 'center',
        backgroundColor: "#eee",
        flex: 1
    },
    imgH:{
        width:400,
        height:150
    }
});
